%close all;

function [PT_X1, PT_X2, PT_X3] = to_binary(X1,X2,X3,height)
    
X1_2t = 64.9162;
X1_4t = 108.953;
X2_2t = 104.809;
X2_4t = 181.406;
X3_2t = 157.209;
X3_4t = 282.221;

dx1 = abs(X1_2t - X1_4t);
dx2 = abs(X2_2t - X2_4t);
dx3 = abs(X3_2t - X3_4t);

minX1 = X1_4t -dx1;
maxX1 = X1_4t + dx1;
minX2 = X2_4t - dx2;
maxX2 = X2_4t + dx2;
minX3 = X3_4t - dx3;
maxX3 = X3_4t + dx3;

    PT_X1 = zeros(size(X1,1),size(X1,2));
    PT_X2 = zeros(size(X2,1),size(X2,2));
    PT_X3 = zeros(size(X3,1),size(X3,2));
    for i = 1:11
        for j = 1:11
            if X1(i,j) > minX1 && X1(i,j) < maxX1
                PT_X1(i,j) = 0;
            else
                PT_X1(i,j) = height;
            end
            if X2(i,j) > minX2 && X2(i,j) < maxX2
                PT_X2(i,j) = 0;
            else
                PT_X2(i,j) = height;
            end
            if X3(i,j) > minX3 && X3(i,j) < maxX3
                PT_X3(i,j) = 0;
            else
                PT_X3(i,j) = height;
            end
        end
    end
end

